import React from 'react';


const fullname = "Timi Ambaye";
const avatar = "/logo192.png"; 


function Board() {
    return (
        <div className="flex justify-center w-full">
            <div className="flex p-2 w-full lg:w-1/2 md:w-full min-h-0 border-2 rounded-xl overflow-hidden">

                <img src={avatar} alt="avatar" className="rounded-full w-44 h-44 bg-gray-900 mr-2" />

                <div className="flex p-2 bg-white items-center">

                    <div className="px-4 w-full h-full flex flex-col justify-between"> 

                        <h2 className="font-bold text-xl my-4">
                            {fullname}
                        </h2><br/>

                        <p className="flex justify-between">
                            <span>Answered questions</span>
                            <span> {7} </span>
                        </p>   

                        <p className="flex justify-between">
                            <span>Created questions</span>
                            <span> {7} </span>
                        </p>  

                    </div>
                </div>
            </div>
        </div>
    )
}

export default Board;
